import React from "react";

import '../styles/'

interface Props {
  items: {
    id: string;
    text: string;
  }[];
  onDeleteTodo: (todo: string) => void;
}

const TodoList: React.FC<Props> = (props) => {
  return (
    <ul>
      {props.items.map((todo) => (
        <li key={todo.id}>
          <span>{todo.text}</span>
          <button onClick={props.onDeleteTodo.bind(null, todo.id)}>
            Delete
          </button>
        </li>
      ))}
    </ul>
  );
};

export default TodoList;
